import React from 'react';
import '../styles/MapView.css';

function MapView() {
  return (
    <div className="map-view">
      <h3>Map</h3>
      <div className="map-placeholder">[Interactive Map Placeholder]</div>
    </div>
  );
}

export default MapView;
